import React from 'react';
import Plotly from "plotly.js"
import * as d3 from 'd3'
import createPlotlyComponent from 'react-plotly.js/factory';
import data from '../graph_4.csv';
const Plot = createPlotlyComponent(Plotly);

export class GraphicGroup extends React.Component {
  // console.log(this.props.name);
  render() {
    return (<SingleGraphic name={this.props.name} x_coordinates={this.props.x_coordinates} y_coordinates={this.props.y_coordinates} type={this.props.type}/>);
  }
}

function SingleGraphic(props) {

  if (props.type === 'scatter') {
    d3.csv(data, function(cvs_data) {
    const trace1 = {
    type: "scatter",
    mode: "lines",
    name: 'AAPL High',
    x: unpack(cvs_data, 'Date'),
    y: unpack(cvs_data, 'AAPL.High'),
    line: {color: '#17BECF'}
  };

  const trace2 = {
    type: "scatter",
    mode: "lines",
    name: 'AAPL Low',
    x: unpack(cvs_data, 'Date'),
    y: unpack(cvs_data, 'AAPL.Low'),
    line: {color: '#7F7F7F'}
  };

  const data_combined = [trace1, trace2];

  console.log(data_combined);

  const layout = {
  title: 'Time Series with Rangeslider',
  xaxis: {
    autorange: true,
    range: ['2015-02-17', '2017-02-16'],
    rangeselector: {buttons: [
        {
          count: 1,
          label: '1m',
          step: 'month',
          stepmode: 'backward'
        },
        {
          count: 6,
          label: '6m',
          step: 'month',
          stepmode: 'backward'
        },
        {step: 'all'}
      ]},
    rangeslider: {range: ['2015-02-17', '2017-02-16']},
    type: 'date'
  },
  yaxis: {
    autorange: true,
    range: [86.8700008333, 138.870004167],
    type: 'linear'
  }
};

return  <Plot
